import * as React from "react";
import App from "./App";


import { createRoot } from "react-dom/client";
import {
  createBrowserRouter,
  RouterProvider,

} from "react-router-dom";


const router = createBrowserRouter([
  {
    path: "/",
    element: <App/>

  },
  {
    path:"ourmenu",
    element:<div>
      <h2>Shrouk</h2>
    </div>
  },
  {
    path:"booktable",
    element:<div>
      <h2>Shrouk</h2>
    </div>
  },

]);

createRoot(document.getElementById("root")).render(
  <RouterProvider router={router} />
);
